def do_algebra(operators, operands):
    precedence = {'**': 4, '*': 3, '/': 3, '+': 2, '-': 2}  # Define operator precedence
    output = []
    stack = []

    def apply_operation(stack, operator):
        second_operand = stack.pop()
        first_operand = stack.pop()
        if operator == '+':
            stack.append(first_operand + second_operand)
        elif operator == '-':
            stack.append(first_operand - second_operand)
        elif operator == '*':
            stack.append(first_operand * second_operand)
        elif operator == '/':
            stack.append(first_operand // second_operand)
        elif operator == '**':
            stack.append(first_operand ** second_operand)

    for i in range(len(operators)):
        operator = operators[i]
        while stack and precedence.get(stack[-1], 0) >= precedence[operator]:
            apply_operation(stack, stack.pop())
        stack.append(operands[i])
        stack.append(operator)

    stack.append(operands[-1])

    while stack:
        apply_operation(stack, stack.pop())

    return stack[0]

