def do_algebra(operators, operands):
    precedence = {'**': 4, '//': 3, '*': 2, '/': 2, '+': 1, '-': 1}

    def evaluate_expression(ops, vals):
        stack = []
        for op, val in zip(ops, vals):
            while stack and precedence[op] <= precedence[stack[-1]]:
                op_top = stack.pop()
                val2 = stack.pop()
                if op_top == '+':
                    stack.append(val2 + val)
                elif op_top == '-':
                    stack.append(val2 - val)
                elif op_top == '*':
                    stack.append(val2 * val)
                elif op_top == '/':
                    stack.append(val2 / val)
                elif op_top == '//':
                    stack.append(val2 // val)
                elif op_top == '**':
                    stack.append(val2 ** val)
            stack.extend([op, val])

        while len(stack) > 1:
            op_top = stack.pop(0)
            val = stack.pop(0)
            val2 = stack.pop(0)
            if op_top == '+':
                stack.insert(0, val2 + val)
            elif op_top == '-':
                stack.insert(0, val2 - val)
            elif op_top == '*':
                stack.insert(0, val2 * val)
            elif op_top == '/':
                stack.insert(0, val2 / val)
            elif op_top == '//':
                stack.insert(0, val2 // val)
            elif op_top == '**':
                stack.insert(0, val2 ** val)

        return stack[0]

    return evaluate_expression(operators, operands)

def minPath(grid, k):
    def dfs(x, y, path_len, path):
        if path_len == k:
            return path

        min_path = []
        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]) and not visited[nx][ny]:
                visited[nx][ny] = True
                new_path = dfs(nx, ny, path_len + 1, path + [grid[nx][ny]])
                if new_path and (not min_path or new_path < min_path):
                    min_path = new_path
                visited[nx][ny] = False

        return min_path

    visited = [[False for _ in range(len(grid[0]))] for _ in range(len(grid))]
    result = []
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            visited[i][j] = True
            result = dfs(i, j, 1, [grid[i][j]])
            visited[i][j] = False
            if result:  # Stop the search if the minimum path is found
                return result

    return result

