def do_algebra(operators, operands):
    precedence = {'+': 1, '-': 1, '*': 2, '//': 2, '**': 3}
    result_stack = []
    operator_stack = []

    def evaluate_top():
        operator = operator_stack.pop()
        operand2 = result_stack.pop()
        operand1 = result_stack.pop()

        if operator == '+':
            result_stack.append(operand1 + operand2)
        elif operator == '-':
            result_stack.append(operand1 - operand2)
        elif operator == '*':
            result_stack.append(operand1 * operand2)
        elif operator == '//':
            result_stack.append(operand1 // operand2)
        elif operator == '**':
            result_stack.append(operand1 ** operand2)

    for i in range(len(operands)-1):
        result_stack.append(operands[i])

        current_operator = operators[i]
        while operator_stack and precedence[operator_stack[-1]] >= precedence[current_operator]:
            evaluate_top()

        operator_stack.append(current_operator)

    result_stack.append(operands[-1])

    while operator_stack:
        evaluate_top()

    return result_stack[0]

