from heapq import heappop, heappush

def minPath(grid, k):
    n = len(grid)
    heap = [(grid[i][0], i, 0, [grid[i][0]]) for i in range(n)]

    while heap:
        val, i, j, path = heappop(heap)
        if len(path) == k:
            return path

        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            ni, nj = i + dx, j + dy
            if 0 <= ni < n and 0 <= nj < n:
                heappush(heap, (grid[ni][nj], ni, nj, path + [grid[ni][nj]]))

def solve(s):
    result = ''
    has_letter = False
    for char in s:
        if char.isalpha():
            has_letter = True
            if char.islower():
                result += char.upper()
            else:
                result += char.lower()
        else:
            result += char
    if not has_letter:
        return s[::-1]  # Reverse the input string when no letters are present
    return result

def do_algebra(operators, operands):
    precedence = {'+': 1, '-': 1, '*': 2, '//': 2, '**': 3}

    def apply_operator(op, num1, num2):
        if op == '+':
            return num1 + num2
        elif op == '-':
            return num1 - num2
        elif op == '*':
            return num1 * num2
        elif op == '//':
            return num1 // num2
        elif op == '**':
            return num1 ** num2

    stack = []
    operator_stack = []

    for i in range(len(operands)):
        stack.append(operands[i])
        if i < len(operators):
            while operator_stack and precedence[operators[i]] <= precedence[operator_stack[-1]]:
                op = operator_stack.pop()
                num2 = stack.pop()
                num1 = stack.pop()
                stack.append(apply_operator(op, num1, num2))
            operator_stack.append(operators[i])

    while operator_stack:
        op = operator_stack.pop()
        num2 = stack.pop()
        num1 = stack.pop()
        stack.append(apply_operator(op, num1, num2))

    return stack[0]
